import React from 'react';

function Services() 
{
    return (
        <div>
            <h2>Nossos Serviços</h2>
            <ul>
                <li>Assistência 24 horas</li>
                <li>Oficina própria</li>
                <li>Frota nova e moderna</li>
                <li>Modelos incríveis e flexibilidade para locação</li>
            </ul>
        </div>
    );
}

export default Services;
